$(document).ready(function(){
	$("#year").ionRangeSlider({
		hide_min_max: true,
		prettify_enabled: false,
		min: 1983,
		max: 2018,
		from: 1983,
		to: 2018,
		type: 'double',
		step: 1,
		prefix: "Год ",
		grid: false
	});
	var chInit = function(){
		$(".filter-box select").chosen({
			disable_search_threshold: 100, 
			allow_single_deselect: true, 
			max_selected_options: 5
		});
	};
	$('.btn-filt').click(function(){
		$('.filter-box').fadeToggle(0);
		chInit();
	});
});


